tables.table_schema:
CREATE TABLE Architects (
    id INT PRIMARY KEY,
    name VARCHAR(255),
    specialization VARCHAR(255)
);

CREATE TABLE Blueprints (
    id INT PRIMARY KEY,
    blueprint_name VARCHAR(255),
    architect_id INT,
    FOREIGN KEY (architect_id) REFERENCES Architects(id)
);

CREATE TABLE Architects (
    architect_id INT PRIMARY KEY,
    architect_name VARCHAR(255) NOT NULL,
    architect_specialization VARCHAR(255)
);

CREATE TABLE Categories (
    category_id INT PRIMARY KEY,
    category_name VARCHAR(255) NOT NULL
);

CREATE TABLE architects (
    architect_id SERIAL PRIMARY KEY,
    architect_name VARCHAR,
    architect_email VARCHAR
);

CREATE TABLE blueprints (
    blueprint_id SERIAL PRIMARY KEY,
    building_id INT,
    blueprint_data JSONB
);

CREATE TABLE users (
    user_id SERIAL PRIMARY KEY,
    user_name VARCHAR,
    user_email VARCHAR
);
